// src/pages/Dashboard.js
import React, { useEffect, useState, useRef, useCallback } from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import { motion } from "framer-motion";
import { FaChevronLeft, FaChevronRight } from "react-icons/fa";

const slides = [
  {
    image: "/hero1.png",
    slogan: "ðŸŒ¿ Relax Your Mind, Refresh Your Soul",
  },
  {
    image: "https://source.unsplash.com/1600x500/?meditation",
    slogan: "ðŸ§˜ Find Your Inner Peace",
  },
  {
    image: "https://source.unsplash.com/1600x500/?wellness",
    slogan: "ðŸ’š Wellness is the New Wealth",
  },
];

const Dashboard = () => {
  const [sessions, setSessions] = useState([]);
  const [currentSlide, setCurrentSlide] = useState(0);
  const slideInterval = useRef(null);

  const nextSlide = useCallback(() => {
    setCurrentSlide((prev) => (prev + 1) % slides.length);
  }, []);

  const prevSlide = useCallback(() => {
    setCurrentSlide((prev) => (prev - 1 + slides.length) % slides.length);
  }, []);

  const stopAutoSlide = useCallback(() => {
    if (slideInterval.current) clearInterval(slideInterval.current);
  }, []);

  const startAutoSlide = useCallback(() => {
    stopAutoSlide();
    slideInterval.current = setInterval(() => {
      nextSlide();
    }, 5000);
  }, [nextSlide, stopAutoSlide]);

  useEffect(() => {
    startAutoSlide();
    return () => stopAutoSlide();
  }, [startAutoSlide, stopAutoSlide]);

  useEffect(() => {
    fetch("http://localhost:8000/sessions")
      .then((res) => res.json())
      .then((data) => setSessions(data))
      .catch((err) => console.error(err));
  }, []);

  return (
    <div className="bg-gray-50 min-h-screen">
      {/* Navbar */}
      <Navbar />

      {/* Hero Carousel */}
      <div className="mt-16 relative w-full overflow-hidden">
        <div className="relative w-full h-[300px] md:h-[500px]">
          {slides.map((slide, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0 }}
              animate={{ opacity: index === currentSlide ? 1 : 0 }}
              transition={{ duration: 0.8 }}
              className="absolute inset-0"
            >
              <img
                src={slide.image}
                alt={slide.slogan}
                className="w-full h-full object-cover"
              />
              <div className="absolute inset-0 bg-black/40 flex items-center justify-center">
                <h2 className="text-white text-xl md:text-4xl font-bold text-center px-4 drop-shadow-lg">
                  {slide.slogan}
                </h2>
              </div>
            </motion.div>
          ))}

          {/* Left Arrow */}
          <button
            onClick={() => {
              prevSlide();
              startAutoSlide();
            }}
            className="absolute top-1/2 -translate-y-1/2 left-4 bg-white/30 hover:bg-white/50 text-white p-2 rounded-full"
          >
            <FaChevronLeft size={20} />
          </button>

          {/* Right Arrow */}
          <button
            onClick={() => {
              nextSlide();
              startAutoSlide();
            }}
            className="absolute top-1/2 -translate-y-1/2 right-4 bg-white/30 hover:bg-white/50 text-white p-2 rounded-full"
          >
            <FaChevronRight size={20} />
          </button>
        </div>
      </div>

      {/* Published Sessions */}
      <section className="container mx-auto py-10 px-4">
        <h2 className="text-3xl font-bold mb-6 text-green-700">
          ðŸŒ¿ Published Sessions
        </h2>
        {sessions.length === 0 ? (
          <p className="text-gray-500">No sessions available yet.</p>
        ) : (
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            {sessions.map((session) => (
              <motion.div
                key={session._id}
                className="bg-white rounded-lg shadow-lg p-4 hover:shadow-2xl transition"
                whileHover={{ scale: 1.05 }}
              >
                <h3 className="text-xl font-semibold text-green-700">
                  {session.title}
                </h3>
                <p className="text-gray-500 mt-2">
                  Tags: {session.tags.join(", ")}
                </p>
                <a
                  href={session.json_file_url}
                  target="_blank"
                  rel="noreferrer"
                  className="text-blue-500 underline mt-3 block"
                >
                  View Session Details
                </a>
              </motion.div>
            ))}
          </div>
        )}
      </section>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default Dashboard;
